apiVersion: v1
kind: ConfigMap
metadata:
  name: core1-cluster1
  namespace: default
data:
  application.yaml: |
    server:
      port: 8080
    spring:
      application:
        name: cloud-shell-config
    cloud-shell:
      image: "121.40.102.76:30080/pml_user_system/cloudshell:v0.7.5"

  k8s-config.cluster: |
    # core9-cluster1 宁夏天翼云
    apiVersion: v1
    clusters:
      - cluster:
          certificate-authority-data: 
          server: https://113.24.56.100:6443
        name: cluster.local
    contexts:
      - context:
          cluster: cluster.local
          user: kubernetes-admin
        name: kubernetes-admin@cluster.local
    current-context: kubernetes-admin@cluster.local
    kind: Config
    preferences: {}
    users:
      - name: kubernetes-admin
        user:
          client-certificate-data: 
          client-key-data: 

  k8s-config.usersystem: |
    apiVersion: v1
    clusters:
      - cluster:
          certificate-authority-data: 
          server: https://172.24.51.21:6443
        name: cluster.local
    contexts:
      - context:
          cluster: cluster.local
          user: kubernetes-admin
        name: kubernetes-admin@cluster.local
    current-context: kubernetes-admin@cluster.local
    kind: Config
    preferences: {}
    users:
      - name: kubernetes-admin
        user:
          client-certificate-data: 
          client-key-data: 

